import React, { Component } from 'react'
import { Link } from 'react-router-dom'

const styleBar = {
  // overflow: 'hidden',
  backgroundColor: '#7E39FB',

}

const styleLink = {
  float: 'right',
  display: 'block',
  color: '#f2f2f2',
  textAlign: 'center',
  padding: '14px 16px',
  fontSize: '17px',
  textDecoration: 'none'
}


// ! Need to fix up logout
const Navbar = () => {
  return (
    <div className="navbar" style={styleBar}>
      <Link style={styleLink} to="/logout">Logout</Link>
      <Link style={styleLink} to="/leadlists">Dashboard</Link>
      <Link style={styleLink} to="/profile">My Profile</Link>
      <Link style={styleLink} to="/">Home</Link>
    </div>
  );
};

export default Navbar;
